import base64

def base64_a_imagen(image_b64, output_path):
    """
    Convierte una cadena Base64 (como 'data:image/png;base64,...') en una imagen y la guarda en disco.
    """
    # Si la cadena tiene el prefijo 'data:image/png;base64,', lo quitamos
    if image_b64.startswith("data:image"):
        image_b64 = image_b64.split(",")[1]

    # Decodificamos la cadena Base64 a bytes
    image_bytes = base64.b64decode(image_b64)

    # Guardamos los bytes como archivo de imagen
    with open(output_path, "wb") as f:
        f.write(image_bytes)
    
    print(f"✅ Imagen guardada en: {output_path}")


# Ejemplo de uso:
if __name__ == "__main__":
    # Aquí pondrías la cadena Base64 (por ejemplo, la que obtienes de self.image_b64)
    base64_string = "data:image/png;base64,"  # recorta o carga la tuya

    # Nombre del archivo de salida
    salida = "imagen_recuperada.png"

    # Llamada a la función
    base64_a_imagen(base64_string, salida)
